import styled from "styled-components";

const Title = styled.h1`
    color: black;
`
const SubTitle = styled.h2`
    color: black;
`

function SecTitle(){
    return (
        <div>
            <Title>
                <h1>EMPRESA XPTO</h1>
            </Title>
            <SubTitle>
                <h2>La tienda que te da premios</h2>
            </SubTitle>
        </div>
    )
}

export default SecTitle
